import React from 'react'
import './Header.css';
const Header = () => {
  return (
    <>
    <div className='Container'>
    
                <nav>
                  <a href='#'>Home</a>
                  <a href='#'>Blogs</a>
                  <a href='#'>Contact Me</a>
                </nav>
   
    </div>
    </>
  )
}

export default Header
